export class ComplicationInsuffisanceSurrenalienne
{
    PatientId:number;
    InsuffisanceSurrenalienne:boolean;
    AgeApparition:number;
    Traitment:boolean;
    Specification:string;
    constructor()
    {
        this.PatientId=0;
        this.InsuffisanceSurrenalienne=false;
        this.AgeApparition=0;
        this.Traitment=false;
        this.Specification='';

    }
}
